	(1, 6, 1, 'Undang-Undang dasar Negara Republik indonesiaTahun 1945 Memberikan jaminan hak Politik Kepada Warga Negara.Contoh hak Politik Warga Negara yang terdapat dalam Undang-Undang Dasar Negara Republik Indonesia Tahun 1945 adalah', 1, 'Mendapatkan Perlakuan baik dari Pemerintah', 'Mencalonkan diri dari KPU', 'Menjadi Pegawai Sipil ', 'Mengikuti Pemilihan Umum', 'Mendirikan Yayasan', 'D', '', '', '', '', '', '', ''),
	(2, 6, 2, 'Setiap Warga Negara Mempunyai Hak yang Di Jamin dalam undang-undang Dasar Negara Republik Indonesia Tahun 1945 .Contoh hak yang di atur secara eksplisit dalam pasal 31 Undang-Undang Dasar negara Republik Indonesia Tahun 1945 adalah', 1, 'Memperoleh Pendidikan', 'Menjadi Anggota legislatif', 'Mendapat Kesejahteraan Sosial', 'Mempelajari Berbagai kebudayaan', 'Mempunyai hak pilih dalam pemilihan umum', 'A', '', '', '', '', '', '', ''),
	(3, 6, 3, 'Negara Mempunyai kewajiban Menyejahterakan rakyat,Upaya Yang dapat di lakukan pemerintah dalam rangka menyejahterakan rakyat yaitu', 1, 'Menyediakan lapangan Pekerjaan', 'Menyediakan Barang-barang Murah', 'Menurunkan harga bahan bakar Minyak ', 'Membuka tempat hiburan bagi Masyarakat', 'Memberi santunan kepADA WARGA NEGARA', 'A', '', '', '', '', '', '', ''),
	(4, 6, 4, 'Pemenuhan Hak Kesetaraan bagi Perempuan oleh negara di bidang Politik di wujudkan dengan', 1, 'Memberi kesempatan Menjadi anggota DPR', 'Menyalurkan Tkw keluarnegri', 'Membebaskan dari kewajiban', 'memberi kesempatan untuk mendirikan lembaga sosial', 'menggantikan semua pekerjaan yang biasa di lakukan laki-laki', 'A', '', '', '', '', '', '', ''),
	(5, 6, 5, 'Undang-Undang dasar Negara Republik indonesiaTahun 1945 Menjamin hak setiap warga negara yang terdapat dalam Pasal 29 ayat 2 Undang-Undang Dasar Negara Republik Indonesia Tahun 1945 adalah', 1, 'Mendapatkan Pekerjaan yang layak serta mendapat imbalan dan perlakuan yang adil', 'Melaksanakan ibadah sesuai agama dan kepercayaan Masing-Masing', 'Memajukan diri dalam memperjuangkan haknya secara kolektif', 'Memperoleh kesempatan yang sama dalam pemerintahan', 'Menganut berbagai agama yang di akui negara', 'B', '', '', '', '', '', '', ''),
	(6, 6, 6, 'Salah satu Titik fokus pasal 27 ayat (1) Undang-Undang Dasar Negara Republik Indonesia Tahun 1945 Menyatakan Bahwa segala warga negara bersamaan kedudukannya di dalam hukum .Maksud Pernyataan tersebut adalah', 1, 'Warga negara yang baik akan di perlakukan baik oleh hukum', 'Pemerintah memberikan hukuman kepada semua warga negara', 'Setiap Warga Negara harus di perlakukan sama di hadapan Hukum', 'Orang yang masuk hukum akan masuk lembaga permasyarakatan', 'Pemerintah dapat membebaskan warga negara yang baik dari hukuman', 'C', '', '', '', '', '', '', ''),
	(7, 6, 7, 'Berikut ini Merupakan Hak seorang Peserta didik yaitu', 1, 'Mendapat Kelompok Piket kelas', 'Membawa kendaraan bermotor', 'Mendapat Pengajaran', 'Mendapat Nilai bagus', 'Memperoleh teman', 'C', '', '', '', '', '', '', ''),
	(8, 6, 8, 'berikut ini Merupakan kewajiban seseorang terhadap Negara Indonesia yang berdampak pada keteraturan sosial adalah', 1, 'Menghormati Para guru', 'Membayar retribusi Parkir', 'Menaati Hukum yang berlaku', 'Menerima semua kebijakan Pemerintah', 'Bekerja Sungguh-sungguh sesuai Profesi', 'C', '', '', '', '', '', '', ''),
	(9, 6, 9, 'Bacalah Wancana Berikut!                                               Menjamunya Pedagang kaki lima di spanjang trotoar jalan menyebabkan terganggunya pejalan kaki ,padahal peraturan daerah mengatur mengenai larangan berjualandi trotoar jalan pemerintahantelah berusaha membangun lokasi berjualan bagi mereka ,akan tetapi mereka menolak direlokasi atas dasar tempat yang di sediakantidak trategis untuk berjualan', 1, 'rendahnya kesadaran warga terhadap hukum', 'rendahnya kepercayaan rakyat terhadap pemerintah', 'rakyat lebih kuasa dari pada perintah dan hukum', 'pelaksanaan hak warga negara untuk kesejahteraan hidupnya', 'Pemerintah tidak mempunyai kekuasaan atas rakyat', 'A', '', '', '', '', '', '', ''),
	(10, 6, 10, 'Hukum Memuat peraturan -Peraturan berupa Perintah dan larangan yang mengatur tingkah laku manusia dalam hidup bermasyarakat .Dari pernyataan tersebut menggambarkan hukum mempunyai sifat', 1, 'Memaksa', 'Mengatur', 'Menyeluruh', 'Memilih', 'Memerintah', 'B', '', '', '', '', '', '', ''),
