	(12, 6, 12, 'Indonesia adalah Negara Hukum tercantum dalam UUD NRI Tahun 1945 Pasal', 1, 'Pasal 1 Ayat (3)', 'Pasal 3 Ayat (1)', 'Pasal 4 Ayat (1)', 'Pasal 5 Ayat (2)', 'Pasal 6 Ayat (1)', 'A', '', '', '', '', '', '', ''),
	(13, 6, 13, 'Segal upaya yang di lakukan Penegak Hukum Untuk Melindungi hak-hak dari subjek hukum agar hak-hak tersebut tidak di langgar di sebut', 1, 'Sistem Hukum', 'Tujuan hukum', 'lembaga hukum', 'Supremasi hukum', 'Perlidungan hukum', 'E', '', '', '', '', '', '', ''),
