	(131, 1, 3, 'Umat islam di perintahkan untuk berlomba-lomba dengan sungguh-sungguh dalam berbuat kebaikan dan menghindari perdebatan yang tidak perlu hingga menghabiskan waktu sia-sia .Berikut ini yang bukan merupakan hambatan dalam menerapkan fastabiqul khairat adalah', 1, 'Kurang ilmu untuk memahami  isi Al-Qur\'an ', 'Merasa diri paling benar dan menganggap pihak lain sesat', 'Memiliki pendirian yang teguh dan konsisten ', 'Merasa cukup dengan amal yang dilakukan', 'tidak mau menerima nasihat dari orang lain', 'D', '', '', '', '', '', '', ''),
	(132, 1, 4, 'Islam sangat Menghargai seseorang yang bekerja keras untuk memperoleh penghidupan yang layak ,dan mengkonsumsi makanan dari hasil usahanya sendiri ,bagi seorang muslim ,etos kerja bukan hanya bertujuan memenuhi kebutuhan hidup duniawi ,tetapi ada tujuan mulia yakni', 1, 'Mencapai pangkat tertinggi', 'Memperoleh harta yang melimpah', 'Sebagai bagian ibadah kepada Allah SWT', 'di muliakan oleh masyarakat', 'Mendapatkan ketenangan hidup', 'C', '', '', '', '', '', '', ''),
	(133, 1, 5, 'Bekerja keras merupakan perilaku mulia yang harus dilakukan setiap muslim .diantara tujuan bekerja dalam islam adalah menolak kemungkaran ,kemungkaran dapat terjadi pada seseorang yang menganggur ,kemungkaran terebut adalah', 1, 'Memiliki cita-cita yang terlalu tinggi', 'Rasa malas dan berpangku tangan ', 'Sulit membedakan antara kebaikan dan keburukan', 'Mendapatkan sumbangan dari orang lain', 'Tergerak untuk memperbanyak ibadah', 'D', '', '', '', '', '', '', ''),
	(134, 1, 6, 'Seandainya Allah Swt,menghendaki ,Niscaya umat Nabi Musa a.s ,Nabi a.s dan umat Nabi Muhamad Saw.akan dijadikan satu umat saja.Tetapi hal ini tidak dikehendaki oleh Allah Swt .Hikmah yang dapat di ambil adalah', 1, 'Manusia memiliki nasib berbeda-beda', 'Agar berlomba dalam kebaikan', 'Terciptanya kehidupan yang baru di bumi', 'Memperluas kewenangan manusia dalam mengolah bumi', 'Semua manusia dikendalikan oleh takdir', 'D', '', '', '', '', '', '', ''),
	(135, 1, 7, 'Iman islam dan ihsan adalah satu kesatuan yang tidak bisa di pisahkan yang kemudian disebut dengan agama islam .Berikut ini yang merupakan pengertian dari iman adalah', 1, 'Mempercayai dengan hati,mengucapkan dengan lisan dan meragukan dengan perbuatan', 'Mempercayai setengah hati ,mengucapkan dengan lisan dan meragukan dengan perbuatan', 'Mempercayai dengan hati ,mengucapkan dengan lisan dan membuktikan dengan perbuatan', 'Mempercayai dengan hati ,menolak dengan ucapan dan membuktikan dengan perbuatan', 'Mempercayai dengan hati ,menyangkal dengan lisan dan membuktikan dengan perbuatan', 'C', '', '', '', '', '', '', ''),
	(136, 1, 8, 'Seorang mukmin adalah seorang yang beriman yang melaksanakan ibadah dengan sangat ikhlas ,seakan-akan Allah Swt,melihatnya meskipun ia tidak melihat Allah Swt.Pernyataan tersebut merupakan definisi dari ', 1, 'Ihsan ', 'Iman', 'Islam', 'Ikhlas', 'Istisab', 'B', '', '', '', '', '', '', ''),
	(137, 1, 9, 'Dimensi dari keimanan itu menyangkut tiga ranah yaitu ma\'rifatun bil qalbi ,iqrarun bil lisan dan amalun bilarkan.dari contoh-contoh amalan dibawah ini yang merupakan cabang iman dalam ranah ma\'rifatun bilqalbi adalah', 1, 'belajar dan menuntut ilmu', 'membaca kalimat thayyibah', 'membaca kitab suci Al-Qur\'an ', 'mengajarkan ilmu kepadaorang lain', 'Mencintai dan membenci karena Allah Swt', 'E', '', '', '', '', '', '', ''),
	(138, 1, 10, 'Beriman pada hakikatnya adalah satu padunya niat,ucapan dan perbuatan ,Berikut ini yang bukan merupakan cabang iman dari ranah perbuatan adalah', 1, 'Mengurus perawatan jenazah', 'Menghindari bacaan yang sia-sia', 'menunaikan dan membayar hutang ', 'meluruskan muamalah dan menghindari riba ', 'menjadi saksi yang adil dan tidak menutupi kebenaran', 'B', '', '', '', '', '', '', ''),
