	(140, 1, 12, 'orang yang beriman ,tidak akan luput dari ujian dan godaan yang terhadap keimanannya semakin beriman seseorang ,semakin besar pula ujian dari AllahSwt.baginya berikut ini yang bukan merupakan ujian bagi seorang mukmin adalah', 1, 'mukmin yang saling membenci satu sama lain', 'mukmin yang saling mendukung satu sama lain', 'datangnya orang munafik yang membenci kaum mukmin', 'godaan hawa nafsu dari dalam diri setiap mukmin itu sendiri', 'orang kafir yang memerangi kaum mukmin dengan tifu dayanya ', 'B', '', '', '', '', '', '', ''),
	(141, 1, 13, 'Bahrul adalah seorang muslim yang taat beribadah dan berprilaku baik di sekolah .sejak SMP dia bercita-cita untuk melanjutkan ke sekolah favorit di kotanya.bahkan dia pernah ber nadzar apabila ia di terima di sekolah tersebut.ia akan berpuasasunah selama tiga hari namun hingga saat ini bahrul belum juga menunaikan nadzar tersebut,karena tiap kali hendak berpuasa,selalu saja ada halangannya untuk menunda ,hal ini merupakan contoh ujian keimanan bagi bahrul yang datangnya dari', 1, 'bisikan setan', 'bisikan orang kafir', 'bisikan dari kaum munafik', 'bisikan orang mukmin lainnya', 'bisikan dari dalam hatinya sendiri', 'E', '', '', '', '', '', '', ''),
