	(143, 1, 15, 'Harta benda yang dimiliki oleh seseorang berpotensi menjerumuskannya dalam jeratan tipu daya setan ,padahal harta karunia Allah Swt.tersebut seharusnya di gunakan sebagai sarana ibadah.berikut ini merupakan contoh penggunaan harta yang benar ,kecuali', 1, 'disedekahkan untuk fakir miskin ', 'di gunakan biaya-biaya sekolah', 'disimpan untuk tabungan hari tua', 'membeli barang mewah dan unik untuk disimpan ', 'memenuhi kebutuhan keluarga', 'D', '', '', '', '', '', '', ''),
	(144, 1, 16, 'Allah Swt.sangat membenci sifat hidup berfoya-foya .oleh karena itu seorang muslim harus menghindari sufat tersebut.salah satu cara menghindari sifat hidup berfoya-foya adalah membiasakan bersedekah dan membantu orang lain.mengapa bisa demikian?', 1, 'sedekah akan mempercepat habisnya harta benda', 'amal kebaikan yang paling sulit dilakukan adalah sedekah', 'karena sedekah dapat menumbuhkan rasa empati kepada sesama', 'tidak ada satu pun manusia yang dapat lepas dari takdir AllahSwt ', 'sedekah akan menjadikan seseorang akan semakin terkenal', 'C', '', '', '', '', '', '', ''),
