	(147, 1, 19, 'Perhatikan pernyataan berikut!    Pada saat yang sudah di tentukan ,kematian akan menjemput setiap manusia itu artinya,kehidupan di dunia hanya sebentar dan sementara.Banyak orang menjadi takabur karena melupakan hal ini.mereka mengira bahwa kehidupan dunia kekal selamanya ,hingga lupa bekal hidup akhirat.                                                      Berdasarkan narasi tersebut ,bekal hidup di akhirat berupa', 1, 'Pangkat,kedudukan dan jabatan', 'Kekayaan harta yang melimpah', 'amal shaleh yang di lakukan dengan ikhlas', 'banyaknya keturunan', 'luasnya pergaulan dan teman dekat', 'B', '', '', '', '', '', '', ''),
