	(338, 9, 22, 'Burning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.\nInstructions burning with two CD Trays\n1. Insert the CD from which you want to burn music into your computer’s CD tray. Insert a blank CD into your computer’s second CD tray.\n2. Open windows media player and wait for it to recognize the CD.\n3. Click the “burn” option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled “Burn List”.\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.\n5. Click the “Start Burn” button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.\n\nWhat is the topic of the text?\n', 1, 'Running two CDs', 'Opening Media Player', 'Copying a compact disc', 'Choosing the blank CD', 'Inserting the CD into computer', 'C', '', '', '', '', '', '', ''),
	(339, 9, 23, 'Burning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.\nInstructions burning with two CD Trays\n1. Insert the CD from which you want to burn music into your computer’s CD tray. Insert a blank CD into your computer’s second CD tray.\n2. Open windows media player and wait for it to recognize the CD.\n3. Click the “burn” option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled “Burn List”.\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.\n5. Click the “Start Burn” button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.\n\nWhat should we do after click the “burn” option at the top of Windows Media Player?\n', 1, 'Choose the blank CD onto which you want to burn your song', 'Open windows media player and wait for it to recognize the CD', 'Wait for your computer to finish the CD, then take both CDs out', 'Click the “Start Burn” button when you have all the songs you want from the CD', 'Drag the songs from the list of Songs', 'E', '', '', '', '', '', '', ''),
	(340, 9, 24, 'Burning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.\nInstructions burning with two CD Trays\n1. Insert the CD from which you want to burn music into your computer’s CD tray. Insert a blank CD into your computer’s second CD tray.\n2. Open windows media player and wait for it to recognize the CD.\n3. Click the “burn” option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled “Burn List”.\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.\n5. Click the “Start Burn” button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.\n\n“The process of copying CD is possible with any computer…” The word “possible” is closest in meaning to…\n', 1, 'Improbable', 'Probable', 'Unlikely', 'Doubtful', 'Suspicious', 'B', '', '', '', '', '', '', ''),
	(341, 9, 25, 'First, turn on television by pressing the power button. This button is usually placed below the screen.\nSecond, if you see satellite antenna (parabola antenna), you need to turn it on by pressing the power button.\nThird, press the power button on the remote control.\nFourth, soon after screen shows some moving pictures, use the remote control to find the television show that you want to watch.\n“……..you need to turn it on ………..”. The underlined word refers to ………..', 1, 'Power button', 'Remote control', 'Satellite antenna', 'Television screen', 'Moving pictures', 'C', '', '', '', '', '', '', ''),
	(342, 9, 26, 'First, turn on television by pressing the power button. This button is usually placed below the screen.\nSecond, if you see satellite antenna (parabola antenna), you need to turn it on by pressing the power button.\nThird, press the power button on the remote control.\nFourth, soon after screen shows some moving pictures, use the remote control to find the television show that you want to watch.\nWhat should we do after turning on the antenna?', 1, 'Select some programs from the tv button', 'Press the power button of the remote control', 'Turn of the television', 'Adjust the antenna position', 'Ready to watch Television', 'B', '', '', '', '', '', '', ''),
