	(345, 9, 29, '1. Find the phone number. Like the website, the phone number to active the credit card will likely be on the card. It may also be in the paperwork with the card.\n2. Have you information ready. You’ll likely need you credit card number, your account number, and the security code on the back of card. The account number should be with the information that came with the card. You may also need your social security number or your date of birth. You may be asked to give your full name.\n3. Call the number. Once you dial the number, you will likely reach a recorded service. Follow the direction given by the system. You may to input information with the keypad, such as your credit card number or security code.\n4. Complete the process. Finish giving the system your information. Once you’ve given all the information, your card Will be activated.\n5. Take off the sticker, and sign the card. Peel the sticker back from the card with the activation information on it. Add your signature to the back of the card.\nTips\n• If you have trouble, call costumer service, and click through until you get a live person. That person can talk to you through the process or active your card for you.\n\nWhat is the most suitable topic for the text?\n', 1, 'How to make a credit card', 'How to make a telephone call', 'How to activate a credit card by phone', 'How to process credit card activation', 'How to activate phone cell', 'A', '', '', '', '', '', '', ''),
	(346, 9, 30, '1. Ensure the fax machine is plugged into a power source and into a working phone jack.\n2. Lay the documents face-up in the fax feeder tray in the order you want them to be received.\n3. Dial the recipient’s fax number and don’t forget the codes for area and country.\n4. Press the “fax” or “send” button.\n5. Check the display to see whether the documents have been successfully sent. If an error happens you can resend them\nWhat is the most suitable title for the text?\n', 1, 'How to turn the fax machine on', 'How to maintain a fax machine', 'How to choose a fax machine', 'How to fax documents', 'How to press the button', 'A', '', '', '', '', '', '', ''),
