	(545, 14, 1, '<p>Dear Rangga. Hi Rangga, Let me introduce myself. I am Michel Jacson, you can call me Laura, I am sixteen years old. I come from Perth, Australia. Its quite close to Nusa Tenggara islands, precisely in the north part of Australia. Would you like to be my friend? Well, iam here to participate in the student exchange program and I attend SMK Persada Utama, Denpasar. It is a nice school and all the people there the participal, teachers, staff and schoolmates are very kind and helpful. I will stay here for about three months. During my stay, I&rsquo;ll live with a local resident, the Affandi family. They are very nice and friendly people and treat me like one of the family. They help me a lot in adapting to the new culture and environment so I feel comfortable and welcome living here. I guess I will love this city. Regards, Laura Smith</p>\r\n<p>How old is Michel ?</p>', 1, '<p>16 years old</p>', '<p>15 years old</p>', '<p>6 years old</p>', '<p>70 years old</p>', '<p>20 years old</p>', 'A', '', '', '', '', '', '', ''),
